import "./.css";
import Wrapper from "./components/Wrapper";
import Circle from "./components/Circle";

export default function App() {
  const colors = [
    "rgb(241, 117, 119)",
    "rgb(236, 206, 151)",
    "rgb(116, 224, 121)",
    "#5cf",
    "rgb(189, 125, 231)",
  ];

  return (
    <Wrapper>
      {colors.map((color, index) => (
        <Circle key={index} color={color} />
      ))}
    </Wrapper>
  );
}
